x.onclick_token_select:
function(node, selected) {
          if (selected) {
            node.attr("stroke-width", "3")
                .attr("stroke", "black");
          } else {
            node.attr("stroke-width", "1")
                .attr("stroke", "black");
          }
        }

x.onclick_activity_select:
function(node, selected) {
            if (selected) {
              node.attr("stroke-width", "2")
                  .attr("stroke-dasharray", "2")
                  .attr("stroke", "black");
            } else {
              node.attr("stroke-width", "1")
                  .attr("stroke-dasharray", "0")
                  .attr("stroke", "#c0c0c0");
            }
          }
